import React from "react";
import styles from "../styles/Main.module.css";

const ServiceComponent = ({ service }) => {
  return (
    <>
      <ul className={styles.service_table}>
        <li className={styles.service_table__first}>
          <span>Послуги</span>
          <span>Ціни</span>
        </li>
        {service.map((service_item) => (
          <>
            <li className={service_item.serv_title.length !== 0 ? styles.service_table__title : styles.unActive}>
              <span>Діагностика автомобіля (50 пунктів)</span>
              <span>300грн.</span>
            </li>
            <li className={service_item.serv_title.length !== 0 ? styles.active : styles.unActive}> 
                <span></span>
                <span></span>
            </li>
            <li>
              <span>{service_item.name}</span>
              <span>{service_item.price}</span>
            </li>
            <li
              className={
                service_item.warning.length !== 0
                  ? styles.under_service__text
                  : styles.unActive
              }
            >
              <p>{service_item.warning}</p>
            </li>
          </>
        ))}
      </ul>
    </>
  );
};

export default ServiceComponent;
